    "script": "\nDROP DATABASE IF EXISTS testdb11417; CREATE DATABASE testdb11417; \n//Create Table\nCREATE TABLE testdb11417.dbo.testtbl16418\n(\n        //Define schema of table\n        UserId          int, \n        Start           DateTime, \n        Region          string, \n        Query           string, \n        Duration        int, \n        Urls            string, \n        ClickedUrls     string,\n    INDEX idx1 //Name of index\n    CLUSTERED (Region ASC) //Column to cluster by\n    PARTITIONED BY BUCKETS (UserId) HASH (Region) //Column to partition by\n);\n\nALTER TABLE testdb11417.dbo.testtbl16418 ADD IF NOT EXISTS PARTITION (1);\n\nDROP FUNCTION IF EXISTS testdb11417.dbo.testtvf13338;\n\n//create table weblogs on space-delimited website log data\nCREATE FUNCTION testdb11417.dbo.testtvf13338()\nRETURNS @result TABLE\n(\n    s_date DateTime,\n    s_time string,\n    s_sitename string,\n    cs_method string, \n    cs_uristem string,\n    cs_uriquery string,\n    s_port int,\n    cs_username string, \n    c_ip string,\n    cs_useragent string,\n    cs_cookie string,\n    cs_referer string, \n    cs_host string,\n    sc_status int,\n    sc_substatus int,\n    sc_win32status int, \n    sc_bytes int,\n    cs_bytes int,\n    s_timetaken int\n)\nAS\nBEGIN\n\n    @result = EXTRACT\n        s_date DateTime,\n        s_time string,\n        s_sitename string,\n        cs_method string,\n        cs_uristem string,\n        cs_uriquery string,\n        s_port int,\n        cs_username string,\n        c_ip string,\n        cs_useragent string,\n        cs_cookie string,\n        cs_referer string,\n        cs_host string,\n        sc_status int,\n        sc_substatus int,\n        sc_win32status int,\n        sc_bytes int,\n        cs_bytes int,\n        s_timetaken int\n    FROM @\"/Samples/Data/WebLog.log\"\n    USING Extractors.Text(delimiter:' ');\n\nRETURN;\nEND;\nCREATE VIEW testdb11417.dbo.testview13893 \nAS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \nAS \nT(a, b);\nCREATE PROCEDURE testdb11417.dbo.testproc15848()\nAS BEGIN\n  CREATE VIEW testdb11417.dbo.testview13893 \n  AS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \n  AS \n  T(a, b);\nEND;",
